{ fn drop(&mut self) { // This is one way to stop socket code (especially PUSH sockets) hanging // at the end of any blocking functions. // // - https://stackoverflow.com/a/38338578/188535 // - http://api.zeromq.org/4-0:zmq-ctx-term self.socket.set_linger(0).ok(); self.socket.set_rcvtimeo(0).ok(); self.socket.set_sndtimeo(0).ok(); // Double result because (a) possible failure on call and (b) possible // failure decoding. if let Ok(Ok(last_endpoint)) = self.socket.get_last_endpoint() { self.socket.disconnect(&last_endpoint).ok(); } }
}

